import { Route } from "react-router-dom";
import React from "react";
import { Drink } from "../Drink/Drink";
import { Pizza } from "../Pizza/Pizza";
import { Sous } from "../Sous/Sous";
import { useSelector } from "react-redux";

import { getpizza } from "../../../../../Selectors/Menus-selector";
import { getsneks } from "../../../../../Selectors/Menus-selector";
import { getdrinks } from "../../../../../Selectors/Menus-selector";

const Containers: React.FC = () => {
  const pizza = useSelector(getpizza);
  const sneks = useSelector(getsneks);
  const drink = useSelector(getdrinks);

  return (
    <div>
      <Route path="/profile/pizza" render={() => <Pizza item={pizza} />} />

      <Route path="/profile/sneks" render={() => <Pizza item={sneks} />} />

      <Route path="/profile/drink" render={() => <Pizza item={drink} />} />

      <Route path="/profile/sous" render={() => <Sous />} />
    </div>
  );
};
export default Containers;
